import Vue_router from 'vue-router';
import First_page from '@/App.vue'
import Create_lobby from '@/components/create_lobby.vue';

const routes = [
    {
        path: '/', 
        redirect: '/home' 
    }, {
        path: '/home',
        component: First_page
    }, {
        path: '/create_lobby',
        component: Create_lobby
    }
]

export const router = new Vue_router({
	mode:'history', //해쉬값 제거 방식
    routes: routes
});
